// frontend/src/pages/ReportsPage.jsx
import React from 'react';

const ReportsPage = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h2>التقارير</h2>
      <div className="alert alert-info mt-3">
        نظام التقارير قيد التطوير - سيتم تفعيله قريباً
      </div>
    </div>
  );
};

export default ReportsPage;
